import { useNavigate } from 'react-router-dom'
import './Components.css';

const MyRecipesBtn = () => {
    const navigate = useNavigate()

    const myRecipes = (event) => {
        event.preventDefault()
        navigate('/my_recipes')
    }

    return (
        <form onSubmit={myRecipes}>
            <div className='dropdown-menu-button'>
                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-person icon" viewBox="0 0 16 16">
                    <path d="M8 8a3 3 0 1 0 0-6 3 3 0 0 0 0 6m2-3a2 2 0 1 1-4 0 2 2 0 0 1 4 0m4 8c0 1-1 1-1 1H3s-1 0-1-1 1-4 6-4 6 3 6 4m-1-.004c-.001-.246-.154-.986-.832-1.664C11.516 10.68 10.289 10 8 10c-2.29 0-3.516.68-4.168 1.332-.678.678-.83 1.418-.832 1.664z" />
                </svg>
                <input className='dropdown-menu-text' type="submit" value="My Recipes" />
            </div>
        </form>
    )
}

export default MyRecipesBtn
